import { connect } from 'react-redux'


class Home extends Component {
    componentDidMount() {
        console.log(window.location.href);
        const fulUrl = window.location.href;
        const lastSlash = fulUrl.lastIndexOf("/");
        console.log(lastSlash);
        const id = fulUrl.substr(lastSlash);
        console.log("id in home", id);

    }
    render() {

        return (
            <p>home page</p>
        )

    }

}
export default connect()(Home)
